import React from 'react';
import { Card } from 'react-bootstrap';
import "./experience.css";

export const Card_item = props => (
    <Card className="text-center">
        <Card.Header>{props.classwork.username}</Card.Header>
            <Card.Body>
                <Card.Title>{props.classwork.name}</Card.Title>
                    <Card.Text>
                    {props.classwork.email}
                    </Card.Text>  
            </Card.Body>
    </Card>
);
